import React from "react";
import "./Month.css"

export default props => {

    const monthNow = new Date().getMonth();
        return(
            <div className="btn-group" role="group" aria-label="Basic example">
                    <button
                        type="button"
                        className="btn btn-primary"
                        autoFocus={props.key===monthNow}
                    >
                        {props.month}
                    </button>
            </div>
        )

}
